import "./BaseERC20.sol";

contract HHMyToken is BaseERC20 {
    constructor(uint initialSupply) BaseERC20("HHMyToken", "HHMTK") {
        address owner = _msgSender();
        _mint(owner, initialSupply * 10 ** decimals);
    }
}

